\begin{V}
# Elevator is at this floor
current_floor = 1

def goto_floor(floor):
  global current_floor
  if floor == current_floor:
    return
  speed = 80
  if floor < current_floor:
    speed = -80
  move_to_floor(speed, floor)
  current_floor = floor
\end{V}

We need to keep calling |get_button| during cabin moves:

\begin{V}
def check_buttons():
  for i in range(4):
    if get_button(i):
      pending[i] = True
      set_light(i, True)

def move_to_floor(speed, floor):
  set_motor(speed)
  while not get_sensor(floor):
    check_buttons()
  set_motor(0)
\end{V}

The main loop has become very simple:

\begin{V}
handler = [ wait1, wait2, wait3, 
            move12, move21, move23, move32,
            open1, open2up, open2down, open3 ]

state = WAIT1
while True:
  handler[state]()
\end{V}

\begin{V}
def move12():
  global state
  check_buttons()
  if not get_sensor(2): return
  if pending[2]:
    request_done(2)
    start_open(OPEN2UP)
  elif pending[3]:
    state = MOVE23
    return
  elif pending[0] or pending[1]:
    request_done(1)
    start_open(OPEN2DOWN)
  else: 
    start_wait(WAIT2)
\end{V}
